import { useState } from 'react';
import './App.css';

function App() {
  const [todos, setTodos] = useState([]);

  return (
    <div className="App">
      <h1>Todos</h1>
      <input type="text" placeholder="Write todo name" />
      <button>Create todo</button>
      <ul>
        {
          todos.map(todo => {
            return (
              <li>
                <span>&#10060;</span>
              </li>
            )
          })
        }
      </ul>
    </div>
  );
}

export default App;
